`;

export default function CurrentWorkoutCard (props) {

    return(
        <div>
            <h3>props.exercise</h3>
            <p>props.sets</p>
            <p>props.exerciseRegion</p>
            <p>props.restPeriod</p>
            <p>props.weight</p>
        </div>
    );
}




